import React, { useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";

const Update = () => {
  const [name, setName] = React.useState("");
  const [rollno, setRollno] = React.useState("");
  const [section, setSection] = React.useState("");
  const [branch, setBranch] = React.useState("");
  const [mobile, setMoblileno] = React.useState("");
  const [fathername, setFathername] = React.useState("");
  const [address, setAddress] = React.useState("");
  const [collagename, setCollagename] = React.useState("");
  const params = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    getProductDetails();
  }, []);

  //my code
  // const getProductDetails = async () => {
  //   let result = await fetch(`http://localhost:5000/details/${params.id}`);
  //   //let result = await fetch("http://localhost:5000/details");
  //   result = await result.json();
  //   setName(result.name);
  //   setRollno(result.rollno);
  //   setSection(result.section);
  //   setBranch(result.branch);
  //   setMoblileno(result.mobile);
  //   setFathername(result.fathername);
  //   setAddress(result.address);
  //   setCollagename(result.collagename);
  // };

  const getProductDetails = async () => {
    try {
      let result = await fetch(`http://localhost:5000/details/${params.id}`);

      if (!result.ok) {
        throw new Error(`HTTP error! Status: ${result.status}`);
      }

      result = await result.json();
      setName(result.name);
      setRollno(result.rollno);
      setSection(result.section);
      setBranch(result.branch);
      setMoblileno(result.mobile);
      setFathername(result.fathername);
      setAddress(result.address);
      setCollagename(result.collagename);
    } catch (error) {
      console.warn("Error fetching product details:", error);
    }
  };

  //my code without try catch
  // const UpdateDetails = async () => {
  //   let result = await fetch(`http://localhost:5000/details/${params.id}`, {
  //     method: "Put",
  //     body: JSON.stringify({
  //       name,
  //       rollno,
  //       section,
  //       branch,
  //       mobile,
  //       fathername,
  //       address,
  //       collagename,
  //     }),
  //     headers: {
  //       "Content-Type": "application/json",
  //     },
  //   });
  //   result = await result.json();
  //   console.warn(result);
  // };

  const UpdateDetails = async () => {
    try {
      const timeoutPromise = new Promise((_, reject) => {
        setTimeout(() => reject(new Error("Request timed out")), 5 * 60 * 1000); // 5 minutes timeout
      });

      const fetchPromise = fetch(`http://localhost:5000/details/${params.id}`, {
        method: "PUT",
        body: JSON.stringify({
          name,
          rollno,
          section,
          branch,
          mobile,
          fathername,
          address,
          collagename,
        }),
        headers: {
          "Content-Type": "application/json",
        },
      }).then((response) => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      });

      const result = await Promise.race([timeoutPromise, fetchPromise]);

      console.warn(result);
    } catch (error) {
      console.error("Error during update:", error);
    }
  };

  return (
    <div>
      <div className="add">
        <h5>Update Product</h5>
        <input
          type="text"
          value={name}
          className="inputBox1"
          placeholder="Enter Name"
          onChange={(e) => setName(e.target.value)}
        />
        <input
          type="text"
          className="inputBox1"
          value={rollno}
          placeholder="Enter Roll.no"
          onChange={(e) => setRollno(e.target.value)}
        />

        <input
          type="text"
          value={section}
          className="inputBox1"
          placeholder="Enter Section"
          onChange={(e) => setSection(e.target.value)}
        />
        <input
          type="text"
          className="inputBox1"
          value={branch}
          placeholder="Enter Branch"
          onChange={(e) => setBranch(e.target.value)}
        />

        <input
          type="text"
          value={mobile}
          className="inputBox1"
          placeholder="Mobile.No"
          onChange={(e) => setMoblileno(e.target.value)}
        />

        <input
          type="text"
          className="inputBox1"
          value={fathername}
          placeholder="Father's Name"
          onChange={(e) => setFathername(e.target.value)}
        />

        <input
          type="text"
          className="inputBox1"
          value={address}
          placeholder="Address"
          onChange={(e) => setAddress(e.target.value)}
        />

        <input
          type="text"
          value={collagename}
          className="inputBox1"
          placeholder="Collage Name"
          onChange={(e) => setCollagename(e.target.value)}
        />
        <button className="button1" onClick={UpdateDetails}>
          Update Details
        </button>
      </div>
    </div>
  );
};
export default Update;
